description:
Rapping With The Gods is made in the best traditions of the long lost art of album making. With its affinity with the past, a lust for the future and plenty of natural soul, Mitchell &amp; Dewbury have created a modern classic. Everyone will love it. Mainstream music lovers; fanatical clubbers; occasional dabblers; specialists, occultists and collectors of all waters. But why?

It&amp;#039;s an essential blend of 21st Century soul, cosmic funk and deep jazz. Percussive heaven united by a positive Spirit. Everyone will recognise some of the scenery, many will spot their musical home - but nobody could possibly recognise it all. It&amp;#039;s clean without being sharp, it&amp;#039;s funky but not dated, it&amp;#039;s an exploration but never an indulgence. Lyrically, it starts with a dream of the opening words of the Bible and ends with the story of passing out from the earth and onwards, past the stars. In between, it picks you up and drops you off but never lets you down.

Discover Mitchell &amp; Dewbury&amp;#039;s inspiration in making &amp;#039;Rapping With The Gods&amp;#039;
